<div class="entities" style="line-height: 2.5; direction: ltr">Update on the genetics characterization of vitiligo . Vitiligo is an autoimmune skin disorder in which autoimmune-mediated destruction of melanocytes caused depigmentation of skin patches . The complex genetics of vitiligo involves multiple susceptibility loci , genetic heterogeneity and incomplete penetrance with gene-gene and gene-environment interactions . In order to clarify the genetic factors , two different principal approaches have applied for the identification of genomic regions or candidate genes that mediate susceptibility to vitiligo . First approach is the genome-wide linkage analyses , which is conducted by scanning of entire human genome for genomic regions that are linked to the development of vitiligo . The other approach is functional candidate gene association ( FCGA ) analyses that detect specific candidate genes , which are expected to involve in disease on the basis of their priori biological functions . Genomic-wide scans have provided a strong support for vitiligo susceptibility genes on chromosomes 4q13 - q21 , 1p31 , 7q22 , 8p 12 and 17p13 , while loci of interest at 6p , 6q , 14q , 9q , 13q , 19p and 22q required further follow-up . Whereas , FCGA studies have identified some candidate genes which are associated with vitiligo , such as HLA , O43918 , Q86XK2 , CAT , Q9UJU5 ,

<h2 style="margin: 0">2</h2>

 ) , and serotonin ( 5HT ) . Protracted in vitro fluoxetine treatment increased cell proliferation and differentiation . The proliferative effects of fluoxetine , 5HT , and the selective agonist of 5HT ( 1A ) receptors trans - 8 - hydroxy - 2 - ( N-n-propyl-N - 3 ' - iodo - 2 ' - propenyl ) aminotetralin ( 8 - OH-PIPAT ) were abolished by the selective antagonist of 5HT ( 1A ) receptors , N - [ 2 - [ 4 - ( 2 - methoxyphenyl ) - 1 - piperazinyl ] ethyl ] - N - ( 2 - pyridinyl ) cyclohexanecarboxamide trihydrochloride ( WAY - 100635 ) . Furthermore , fluoxetine-induced activation of both the DB02527 - response element-binding ( CREB ) protein and extracellular signal-regulated protein kinases (

<h2 style="margin: 0">3</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">DB01221 receptor modulation by the neuropeptide apelin : implications for excitotoxic injury . Excitotoxic neuronal damage via over-activation of the DB01221 receptor has been implicated in many neurodegenerative diseases . In vitro modeling of excitotoxic injury has shown that activation of G-protein coupled receptors ( GPCRs ) counteracts such injury through modulation of neuronal pro-survival pathways and / or DB01221 receptor signaling . We have previously demonstrated that the GPCR 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and its endogenous neuropeptide ligand apelin can protect neurons against excitotoxicity , but the mechanism ( s ) of this neuroprotection remain incompletely understood . We hypothesized that apelin can promote neuronal survival by activating pro-survival signaling as well as inhibiting DB01221 receptor-mediated excitotoxic signaling cascades . Our results demonstrate that ( i ) apelin activates pro-survival signaling via inositol trisphosphate ( IP ( 3 ) ) , protein kinase C ( PKC ) , mitogen-activated protein kinase kinase 1/2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q02750

</mark>
 / 2 ) , and extracellular signal-regulated kinase -1/2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P27361
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / 2 ) to protect against excitotoxicity , and ( ii ) apelin inhibits excitotoxic signaling by attenuating DB01221 receptor and calpain activity , and by modulating DB01221 receptor subunit 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 phosphorylation at serine 1480 . These studies delineate a novel apelinergic signaling pathway that concurrently promotes survival and limits DB01221 receptor-mediated injury to protect neurons against excitotoxicity . Defining apelin-mediated neuroprotection advances our understanding of neuroprotective pathways and will potentially improve our ability to develop therapeutics for excitotoxicity-associated neurodegenerative disorders .</div>

 and affect its related functions in vascular SMCs . In this study we examined lycopene effect on PDGF-AA / - AB-induced signaling and migration in SMCs and fibroblasts . We found that lycopene inhibited PDGF-AA-induced SMC and fibroblast migration in a concentration-dependent manner . Lycopene reduced PDGF-AA signaling , including phosphorylation in

 and its downstream protein kinases / enzymes . It also inhibited PDGF-AB-induced signaling and cell migration . However , lycopene did not affect PDGF-induced reactive oxygen species production and H2O2 - induced

 . Furthermore , we have shown that haloperidol induces neurotoxicity of neuronal cells via DB01221 receptor complex , accompanied by dissociation of Ras -
